const Teams = () => {
    
    const addedTeam = [
        {teamName: "TeamA"},
        {teamName: "TeamB"},
        {teamName: "TeamC"}
    ];

    return(
        <>
            <div className="container">
                <div className="row justify-content-center">
                    <div className="col-10">
                        <ul className="list-group">
                            {
                                addedTeam.map((employee, index) => 
                                <div className="list-group-item list-group-item-action" data-bs-toggle="collapse" data-bs-target={'#'+employee.teamName}>
                                {employee.teamName}
                                <div className="collapse" id={employee.teamName}>
                                <div className="card-body">
                                    1
                                </div>
                            </div>
                            </div>
                                )
                            }
                        </ul>
                    </div>
                </div>
            </div>
        </>
    )
}

export default Teams;
